import React, { useState } from 'react';
import styled from 'styled-components';

const WrappedComponent1 = styled.svg`
  flex: none;
  transition: fill 0.25s;
  width: 48px;
  height: 48px;

  ${Link}:hover & {
    fill: rebeccapurple;
  }
`;

// This function takes a component...
const wrapperComponentMethod = (Icon1: React.FC, Icon2: React.FC) => () => {
  const [iconVisiblity, setVisible] = useState(false);
  const iconCTA = () => {
    setVisible(true);
  };
  return (
    <div onClick={iconCTA}>
      {!iconVisiblity && <Icon1 />}
      {iconVisiblity && <Icon2 />}
    </div>
  );
};

export default wrapperComponentMethod;
